import axios from 'axios';
import React, { useEffect } from 'react';

const FetchPolicyNames = () => {
  useEffect(() => {
    const fetchPolicies = async () => {
      try {
        const response = await axios.get('http://localhost:8080/admin/check/maddy.mohith143@gmail.com');
        console.log(response.data);
      } catch (error) {
        console.error('There was an error fetching the policies!', error);
      }
    };

    fetchPolicies();
  }, []);

  return <div>Check the console for the list of policies.</div>;
};

export default FetchPolicyNames;
